import React from 'react';
import { IconButton, Grid } from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowLeftIcon from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';

const ComparisonSudokuCell = ({
  cellData,
  subgridIndex,
  manualPencilMode,
  manualPencilColors,
  manualPencilMarks,
  handleCellClick,
  handlePencilMarksChange,
  handleCellChange,
  showPencilMarks,
  isOriginalCell,
  isUserCell,
  pencilMarks,
  generatedCellValue,
  selectedColor,
  applyColorToCell,
}) => {
  const { value, symbols } = cellData;

  return (
    <div className={`sudoku-cell subgrid-${subgridIndex}`}>
      <Grid container direction="column">
        <Grid item container justifyContent="space-between">
          <IconButton size="small">
            {symbols.includes('^') && <KeyboardArrowUpIcon />}
          </IconButton>
          <IconButton size="small">
            {symbols.includes('v') && <KeyboardArrowDownIcon />}
          </IconButton>
        </Grid>
        <Grid item container justifyContent="space-between">
          <IconButton size="small">
            {symbols.includes('<') && <KeyboardArrowLeftIcon />}
          </IconButton>
          {value}
          <IconButton size="small">
            {symbols.includes('>') && <KeyboardArrowRightIcon />}
          </IconButton>
        </Grid>
      </Grid>
    </div>
  );
};

export default ComparisonSudokuCell;
